import React from 'react'
import './Navbar.css';
import logo from '\\Assets\\Brown Mountain Travel Retro Logo-Photoroom.png'

const Navbar = () => {
  return (
    <>
    <nav id="navbar">
        <img src={logo} />
    </nav>
    </>
  )
}

export default Navbar
